import './Mat.css'
import PropTypes from 'prop-types'

const IncreaseMat = ({ value }, { matmessage }) => {
    return (
        <div className='increase_mat'> { value } { matMessage }
        </div>
    )
}

IncreaseMat.propTypes = {
    value: PropTypes.number.isRequired,
    matMessage: PropTypes.string,
  };

export default IncreaseMat;
